import { useState, useEffect} from 'react'

export default function Search() {
  const [name, setName] = useState('');

  const types = ["All", "Normal", "Fire", "Water", "Electric", "Grass", "Ice", "Fighting", "Poison", "Ground", "Flying", "Psychic", "Bug", "Rock", "Ghost", "Dragon", "Dark", "Steel"]

  return (
    <div>
      <div>
        <div>
          <input></input>
        </div>
        <div>
          <h3>Primary Type: </h3>
          <select>
            {types.map(type => (
              <option>{type}</option>
            ))}
          </select>
        </div>
        <div>
          <h3>Secondary Type: </h3>
          <select>
            {types.map(type => (
              <option>{type}</option>
            ))}
          </select>
        </div>
      </div>
    </div>
  )
}
